import { Link } from "@mui/material";

const Nav = () => {
  return (
    <div className="nav">
      <nav>
        <Link to="/about">
          <a href="">About</a>
        </Link>
        <a href="">Contact</a>
      </nav>
    </div>
  );
};

export default Nav;
